import React,{useState,useEffect} from "react";
import axios from "axios";




const Menu = () => {
    let [page,setPage] = useState(1);
    let [food,setFood] = useState([]);
    let [type,setType] = useState('고기');

    useEffect(()=>{
        axios.get("http://localhost:8080/food/menu",{
            params:{
                page:{page},
                type:{type}
            }
        }).then(res=>{
            console.log(res.data)
        })
    },[])
    let foodList={food}.map((m)=>(
        <div className="col-md-3">
            <div className="thumbnail">
                <a href="#">
                    <img src={m.poster.substring(0,m.poster.indexOf("^"))} alt="Lights" style={{"width":"100%"}}/>
                    <div className="caption">
                        <p style={{"fontSize":"8px"}}>{m.name}</p>
                    </div>
                </a>
            </div>
        </div>
    ))
    return(

        <div>
            {foodList}
        </div>
    )
}

export default Menu
